const wishListActionType = {
    TOGGLE_LIST_HIDDEN: 'TOGGLE_LIST_HIDDEN',
    ADD_ITEM: 'ADD_ITEM',
    CLEAR_ITEM_FROM_LIST: 'CLEAR_ITEM_FROM_LIST',
    REMOVE_ITEM: 'REMOVE_ITEM',
    CLEAR_LIST:'CLEAR_LIST'
};
  
export default wishListActionType;
